import React from 'react';
import './AboutUs.css';

const AboutUs = () => {
    return (
        <div className="about-us-page">
            <header>
                <h1>About Us</h1>
            </header>
            <main>
                <p className="intro">SIGMA STORY
                    Driven by Detail, Focused on the Future</p>
                <div className="content">
                    <h2>Transforming through Technology</h2>
                    <p></p>
                </div>
            </main>
        </div>
    );
};

export default AboutUs;
